import React from "react";
import "./Collect.css";

const Collect = () => {
  return (
    <div className="Collect">
      <div className="collect-lang-background">
        <div className="print">Hello</div>

        <div className="text2">issue it at the counter to get your SAVINGS</div>
      </div>
    </div>
  );
};

export default Collect;
